import React from "react";
import "./nav.css";
import { NavLink } from "react-router-dom";


const Nav = () => {
  return <div className="nav">
    <div>logo</div>
    <div><NavLink exact to="/" className="nav-logo">
          ALL POSTS
          <i className="fas fa-code"></i>
        </NavLink></div>
    <div></div>
  </div>;
};

export default Nav;
